import React from 'react';
import Address from './components/Address';

const Home = (props) => {

    return (
        <div className="Home">
            <Address single={props.single} emails={props.state.emails} selectAddress={props.selectAddress} selAdd={props.state.selAdd} changeName={props.changeName}/>
        </div>
    )

}

export default Home;
